import React from "react";

const NoGoal = () => {
  const noGoalStyles = {
    textAlign: "center",
    backgroundColor: "white",
    color: "pink",
    border: "red",
  };
  return (
    <div className="no-goal" style={noGoalStyles}>
      No Goals to Show!
    </div>
  );
};

export default NoGoal;
